import React, {Suspense} from 'react';
import './App.css';
import Routes from "./routes";
import {Route, Router, Switch} from "react-router-dom";
import Home from "./Components/Home/Home";

function App() {
  return (
    <div className="App">
        <Router>
            <Suspense fallback={<LinearProgress />}>
                <Switch>
                    <Route path="/" component={Home} />
                </Switch>
            </Suspense>
        </Router>
    </div>
  );
}

export default App;
